create table cache (
id bigint not null,
created_by varchar(255) not null,
created_on datetime2 not null,
sync bit,
modified_by varchar(255) not null,
modified_on datetime2 not null,
version bigint,
client_code varchar(30) not null,
status varchar(255),
sync_date datetime2,
primary key (id));

create table hrp_report (
id bigint not null,
created_by varchar(255) not null,
created_on datetime2 not null,
sync bit,
modified_by varchar(255) not null,
modified_on datetime2 not null,
version bigint,
client_code varchar(30) not null,
created_date date,
hrp_file_name varchar(255),
invoice_amount numeric(19,2),
invoice_date date,
invoice_id varchar(255),
pay_date date,
pay_period_end_date date,
payroll_description varchar(255),
payroll_id varchar(255),
project_code varchar(255),
project_description varchar(255),
report_type varchar(255),
sequence int,
primary key (id));

create table hrp_reports_last_run (
id bigint not null,
created_by varchar(255) not null,
created_on datetime2 not null,
sync bit,
modified_by varchar(255) not null,
modified_on datetime2 not null,
version bigint,
client_code varchar(255),
last_run_date_time datetime2,
user_id varchar(255),
report_definition_id bigint,
primary key (id));

