sequence bigint,
report_def_field_id bigint,
report_definition_id bigint,
primary key (id));

create table report_def_field (
id bigint not null,
data_security_field_name varchar(255),
data_security_type varchar(255),
data_type varchar(255),
default_sequence bigint,
display_field_name varchar(255),
field_name varchar(255),
field_type varchar(255),
function_name varchar(255),
is_data_security_field bit,
is_default bit,
is_format bit,
